(1092, 0, 294, 0, 'RTPs Core Figure', 'Peter Fonagy (* 14. August 1952 in Budapest) Psychologist and Psychoanalyst, Sigmund Freud Professor at University College London. ', '', 'Juveniler Diabetes mellitus und die Ursachen fr die Nichtbefolgung rztlicher Ratschlge war der erste Forschungsschwerpunkt des jungen Fongay. Peter Fonagy ist Professor am University College London, er hlt dort den Freud Memorial Chair und leitet die Psychoanalytic Unit fr Doktorratsstudenten. Zudem ist er Forschungskoordinator am Anna Freud Centre (London) und in dieser Position Nachfolger von Anna Freud und Joseph Sandler. Er ist Vize-Prsident der Internationalen Psychoanalytischen Vereinigung sowie Mitherausgeber einer Anzahl von Fachzeitschriften, z.B. des International Journal of Psychoanalysis, von Development and Psychopathology und des Bulletin of the Menninger Clinic.\r\nFonagy bemht sich insbesondere um empirische und interdisziplinre Psychotherapieforschung mit den Schwerpunkten Bindungstheorie, Mentalisierung und Psychoanalyse. Er gilt in dieser Hinsicht als einer der weltweit fhrenden Kpfe.[1] [2]\r\nEr gilt als Urheber des Konzeptes der Mentalisierung, welche die Theorie of Mind-Forschung und Bindungstheorie mit psychoanalytischen Theorien verknpft. Auf der Grundlage des Mentalisierungskonzeptes entwickelte Fonagy mit seinen Mitarbeitern die Mentalisierungsbasierte Psychotherapie oder Mentalisierungsgesttzte Psychotherapie (Mentalisation-Based-Treatment, kurz: MBT). Diese Besondere Form der psychodynamischen Langzeitpsychotherapie wird zur Behandlung schwerer Persnlichkeitsstrungen wie der Borderline-Persnlichkeitsstrung und der Dissozialen-Persnlichkeitsstrung eingesetzt.', 'Fonagy_Bibliography.pdf', '2009-05-28', 'Fonagy_P.jpg', 'short', NULL, NULL, NULL, NULL, NULL, '2009-08-09', 1),
(1093, 0, 296, 0, 'The mediator between research and practice', 'Trained in a Kleinian mode in Santiago, then doctoral student in Ulm, now professor of psychiatry in Santiago, successful mediator between worlds.\r\nHe and his wife Gabriella translated the Um textbook into spanish.', '', '', 'Jimnez.pdf', '2009-05-28', 'Jimenez_Juan.jpg', 'short', NULL, NULL, NULL, NULL, NULL, '2009-08-17', 1),
(1094, 0, 458, 0, 'Staff Visiting the Freud home', '', '', 'ANNOUNCEMENT    Thu, 18 Jan 1996\r\n\r\nThe IPA Standing Committee on Psychoanalytic Research is pleased to announce the Second Annual Research Training Programme. The Programme is focused around a Faculty of IPA Visiting Professors in Psychoanalytic Research in the University of London. The second programme will be held from 8th-17th August 1996, based at University College London which is situated in Bloomsbury,\r\nthe academic quarter in the heart of London. \r\n\r\nAs in the previous year, the aims of the programme of lectures and seminars will be to provide an intensive training in empirical approaches to psychoanalytic research in two areas: developmental research (Robert Emde); the study and measurement of psychotherapeutic process and outcome (Wilma Bucci, Horst Kachele and Otto Kernberg). The curriculum will include an introduction to current research methods, as well as particular applications as exemplified by the research programmes of the current teachers. A central part of the experience for trainees will be the opportunity to discuss their own research interests and research projects with members of the Faculty and other participants. This programme should provide a constructive and critical review of projects in a way that should generate incentives for continuing psychoanalytic research. We anticipate that participants will benefit from networking with consultants and collaborators for their future work.\r\n\r\nThe University has a number of other distinguished contributors to the field of psychoanalytic research including Peter Hobson who is Professor of Developmental Psychopathology and Professor Peter Fonagy who is Freud Memorial Professor of Psychoanalysis. It is hoped that visiting Faculty, together with the permanent University staff, will provide an exciting scientific event. The University is close to two major London psychoanalytic institutions, the Tavistock Clinic and the Anna Freud Centre. We hope to provide participants with relatively inexpensive University accommodation with the alternative of hotel accommodation near by. We expect that participants will be able to spend time with each other and Faculty members, both as part of the teaching programme and outside timetabled events. \r\n\r\nThose interested should write as soon as possible to: \r\n\r\nPeter Fonagy\r\nChair, IPA Standing Committee on Research Psychoanalysis Unit\r\nUniversity College London\r\nGower Street London WC1E 6BT\r\nFax: 44 171 916 1989\r\n\r\nA brief CV and details of your research interests and current research involvement should be enclosed.', '', '2009-05-29', 'RTP_96_staff.jpg', 'short', NULL, NULL, NULL, NULL, NULL, '2015-03-11', 1),
