(1532, 0, 619, 0, 'RTP 2006', 'RTP 2006\r\nThe rtp was the best research training I\'ve ever had.  Even though I have not found my way into a position that supported research, I do a great deal of advising of students developing research projects and some of the methods I learned in London certainly find their way into those.  Maybe more importantly, I live in a place where there are almost no psychoanalysts, and the psychoanalytic thought my students are exposed to dates mostly from the 1950s or earlier.  I am able to introduce them to newer ideas, more modern applications that seem useful and manageable to their current day practice. \r\n\r\nHarriet W. Meek, Ph.D., LiSW \r\nAlbuquerque, New Mexico\r\nContributing Faculty, Walden University\r\nHuman Service Doctoral  Program', '', '', '', '2011-01-09', '', 'short', NULL, NULL, NULL, NULL, NULL, '2012-12-24', 1),
