(2293, 0, 493, 0, '0 Negativ-Beispiel', 'Sehr geehrter Herr Professor Kchele,\r\nbei der Suche im Interne unter dem Stichpunkt \"Therapieschden\" bin ich auf Ihren Namen und Ihr jetziges Bettigungsfeld \"Fehlerkultur in der PT\" aufmerksam geworden.\r\n\r\nIch habe wegen gravierender psychischer Probleme whrend mehrere Jahr vier Psychotherapien (2x VT, 1x TF und eine TF gemischt mit Paartherapie) gemacht , die mehr alle mehr geschadet als geholfen haben. Mein Problem ist lngst chronisch (dauernde Krankheitsngste).\r\nDer Therapeut war nie bereit, mit mir ber meine Kritik zu sprechen - von wegen Fehlerkultur.\r\nMit freundlichen Gren', '', '', 'Therapie_Nr._2-1.pdf', '2013-08-27', '', 'short', NULL, NULL, NULL, NULL, NULL, '2013-08-27', 1),
