(2547, 0, 1102, 0, '0 Contents', 'Part 1 From past to present. Development of a plurality during the one hundred year old history of research in psychoanalysis by M. Leuzinger-Bohleber.\r\n\r\nConceptual research in psychoanalysis by D. Scarfone.\r\n\r\nPsychoanalytic research in Latin America: Challenges by R. Bernardi. \r\n\r\nPart 2	Methodological and epistemological issues on process and outcome research.\r\n\r\nResearch issues in psychoanalysis by P.Fonagy\r\n\r\nMethodological considerations in evaluating the outcome of psychoanalysis by P. Fonagy.\r\n\r\nPart 3 Descriptions of studies.\r\n\r\na)	Conceptual studies \r\nb)	Clinical case studies\r\nc)	Process Studies\r\nd)	A.	Helping alliance\r\ne)	B.	Transference\r\nf)	C.	Countertransference\r\ng)	D	Therapist\r\nh)	E 	Dream\r\ni)	F	Defense\r\nj)	G.	Attachment\r\nk)	Naturalistic studies\r\nl)	Pre-post studie	\r\nm)	Quasi-experimental studies\r\nn)	Experimental treatment studies\r\no)	Cost-effectiveness studies\r\np)	Neuropsychoanalytical Studies\r\nq)	Further psychoanalytical studies\r\n\r\nPart 4: A metaanalysis on outcome studies on longterm psychoanalytical treatments and psychoanalyses by F. Leichsenring\r\n\r\nPart 5: References\r\n\r\n', '', '', '', '2014-04-05', '', 'short', NULL, NULL, NULL, NULL, NULL, '2018-08-29', 1),
(2548, 0, 1105, 0, 'Foreword', 'The first edition of the open door review has been a considerable success. The IPA has sold at cost of reproduction all the copies that were printed. Nevertheless requests have continued to come in, so we had the choice of updating or reprinting. If you look at the expanded sections of the second edition, I hope you will agree with us that a new edition was the only way to go. Considerable progress has been made over the last 3 years, and we felt this should be reflected in the review. We are pleased that the review now exists in 3 languages: Portuguese and Spanish in addition to the English. The interest of Latin-American psychoanalysts in research is also reflected by the many new sections in the current edition reporting work from that region. ', '', '', '', '2014-04-05', '', 'short', NULL, NULL, NULL, NULL, NULL, '2014-04-05', 1),
(2549, 0, 1106, 0, 'Measures', 'n entirely new section on measures has been added under the editorship of John Clarkin, with significant contributions from Andrew Gerber. Measurement methodology continues to be an urgent need for many experienced as well as novice researchers. Providing accounts of some of the most frequently used psychoanalytic instruments seems helpful and appropriate. Note that a number of measures, particularly those related to the monitoring of psychoanalytic process, are listed in the Appendix. This has enabled us to link them to studies where they have been applied at the same time as gathering them in one place for easy identification. \r\n', '', '', '', '2014-04-06', '', 'short', NULL, NULL, NULL, NULL, NULL, '2014-04-06', 1),
