(3197, 0, 1266, 0, 'Prof. Kalina X,mas -letter 2015', 'Dear Sir Horst Kaechele!\r\n\r\nI was going to write you, you the scientist who personify European psychoanalysis, about Crimean business and troubles, associated with psychoanalytically oriented psychotherapy, long time ago. I hope you didnt forget our department and our meeting in Kiev and Crimea and doesnt disappoint in sensation of my sincere devotion to psychoanalysis.\r\n\r\nAssume, you remember our department of deep psychology and psychotherapy in Ukrainian National University and, thank God, it continues to exist in Russian Federal University. Certainly, above all a lot have changed and also in my life. My daughter and son-in-law have moved to Kiev and are successful there, although Olga have changed psychology to journalistic, its better paid, unfortunately. Not as much paid by Ukraine, though, but by USA. Still she is a prosperous journalist and happy mother, and I finally become a grandmother. Granddaughter is called Polina.\r\n\r\nIt may seem weird, but I still hope that Crimean psychoanalysis will live and even evolve. Such optimism looks and is almost groundless, but, I think, it gives a credit for psychoanalytically oriented psychotherapy and I dont want to abandon main business of my (and my late husbands) life.\r\n\r\nIm writing this letter from the house (youve been there) where electricity is giving according to schedule and hot water is infrequent luxury. But my library (your two-volume edition with signature is its pearl), my cats, my Ukrainian national identity and psychoanalysis related ambitions left unharmed. \r\n\r\n  My main wealth now is memories in which you constantly present as personification of Crimean-European psychoanalytical connection. I wish you a merry Christmas and waiting for reply from Ulm.\r\n\r\nSincerely yours                                                                                                                              prof. N.F. Kalina\r\n\r\n', '', '', '', '2015-12-27', '', 'short', NULL, NULL, NULL, NULL, NULL, '2015-12-27', 1),
