(3343, 0, 1359, 0, 'Kchele, Horst: The Shadow of the Past on the Present', 'The Shadow of the Past on the Present \r\n\r\nThe report deals with the issue of past and present reality in the psychoanalytic treatment of a psychologist who came for depressive symptoms following the rejection for psychoanalytic training. The actual professional and personal reality of the patient could be characterized by a strong denial of her family history. Her father had been working as an SS-officer in Hitlers retreat on the Obersalzberg. After the end of the Third Reich he successfully supported by the patients family could leave behind his political involvement. The impact on the patient s psychosexual development will be detailed in the presentation. It took some years of analytic work to help the patient to get in touch with the shadows of the past.\r\n\r\n\r\nNazi SS Subay babasnn bastrlm anlaryla alanm i dnyasna arpc bir ekilde kar konumdaki sol grl psikoloji rencisi\r\n\r\nBu alma; bir psikoloun psikanalitik eitimin reddedilmesini takiben depresif semptomlarla bavurduu psikanalitik almasndaki gemi ve gnmze dair\r\ngereklikle ilgilidir. Hastann gncel profesyonel ve kiisel gereklii kendi aile hikayesini kuvvetli bir ekilde reddetmesiyle ilikilendirilebilir. Bayan hastann babas Hitlerin Obersalzberge geri ekildii dnemde SS-subay olarak alyordu.\r\nnc Nazi dnemi sonlandktan sonra, hastann babas evde baarl bir ekilde desteklenerek, politik faaliyetlerini geride brakabildi. Hastann psikoseksel geliiminin detaylarna sunumda yer verilecektir. Hastann gemiinin glgesiyle \r\ntemas etmesine yardm etmek birka yl sren analitik almayla mmkn oldu. \r\n', '', '', 'The_Shadow_of_the_Past_on_the_Present.pdf', '2016-06-19', '', 'short', NULL, NULL, NULL, NULL, NULL, '2016-06-19', 1),
