(3346, 0, 1359, 0, 'Fiek, Gler Okman: Psiik Gerekliin D Gereklik Olduu Nokta: Maduriyet ve Diren.', 'Bu yaz i ve d gereklik sorununu kuramsal deelendirmeler ve bir klinik vaka sunumu yoluyla ele almaktadr. yks ailesel travmas kadar kendi i atmalarn da yanstan bir kadn danann durumu ele alnacaktr. Konu Freudun klasik duruundan gnmzn znellikleraraslk yaklamna kadar gelen ksa ve ksmi bir tarihsel bakla tartlacaktr. Ama bugnn dnyasnda klinisyenleri karlayan baz sorular ele almak olacaktr.\r\n\r\n Where Psychic Reality is External Reality: Victimization and Resistance\r\nThis paper discusses the issue of psychic versus external reality through both theoretical considerations and a clinical case material. The case of a woman whose story reflects both her familial trauma and her internal struggles is presented. A brief and partial historical look at the issue from Freuds classical stance to todays intersubjective ethos aims to cover some questions facing clinicians in todays world. \r\n', '', '', '', '2016-06-19', '', 'short', NULL, NULL, NULL, NULL, NULL, '2016-06-19', 1),
(3347, 0, 1359, 0, 'Sahin, Alper ', 'Gereklik ve Psikanalitik Aratrmalar\r\n\r\nPsikanalitik bilgiyi nasl ediniyoruz? Bu bilginin geerli gvenilir ve genelletirilebilir olduunu syleyebilir miyiz?\r\nGreen Freudun eserlerinde ampirik aratrmalardan hi bahsedilmediini sylerken Freudun son derece yetkin bir aratrmac olarak nroloji labaraturlarnda altn ve yaynlar yaptn Makari ifade edilmektedir. Ancak klinik vaka almalarnn dnda deneysel almalar psikanaliz tarihinin yakn zamanlarna kadar grlmez. Peki neden son zamanlarda ampirik almalar yapmak psikanaliz camias iin nemli olmutur? Psikanaliz alannda bilimsel aratrma yapma konusu yntemle ilgili tartmalar beraberinde getirmektedir. Neden psikanalitik aratrmalar tek vaka aratrmalar gibi niteliksel aratrmalar ile snrl kalmtr? Psikanaliz nasl bir bilimsel disiplidir? Yoksa dier bilim alanlarndan yaltlm kendi paradigmas iine kapanm bir sanat/zanaat alan mdr? Eer bilimsel bir disiplin ise kendi epistemolojisi ve aratrma yntemleri var mdr? Ya da hangi aratrma yntemlerini kendi disiplini iinde ve ne ekilde kullanmaktadr? Btn bu sorularn psikanaliz almalarna yarar nedir? Bu alma Psikanalitik gereklik sorunsalndan yola karak psikanaliz ve bilimsel aratrma konularn Psikanalizin temel varsaymlar balamnda tartmay amalamaktadr.\r\n\r\nThe Reality and Psychoanalytical Research\r\n\r\nHow do we get psychoanalytical knowledge? Is knowledge reliable, valid and generalizable? Even though Green pointed out that Freud do not mention about Research in his works (in Standard Edition), Makari reminds that Freud was a successful researcher with his publications on neurology. Nonetheless empirical research is not common in the psychoanalytical environments till nowadays, even though clinical case presentations formed the main area of scientific evidences. So, why lately empirical researches became more popular in the psychoanalytic environments? The matter of researching in psychoanalysis brings the problematic of methodology to the discussion. Why psychoanalytical researches were only limited in the qualitative research methodology? What kind of scientific discipline is psychoanalysis? Or is it a art/craft isolated from scientific knowledge and closed in its own paradigm. If it is a scientific discipline has it its own epistemology and methodology? Or what kind of research methodologies and how it uses in the discipline? What kinds of contributions are expected from all these questions to the psychoanalytical works? This presentation aims to discuss psychoanalysis and scientific research matter basing on reality problematic and in terms of basic psychoanalytical assumptions.\r\n', '', '', '', '2016-06-19', '', 'short', NULL, NULL, NULL, NULL, NULL, '2016-06-19', 1),
(3348, 0, 1359, 0, 'Buchholz, Michael Conversational errors  looking at the details of how psychotherapists talk in typical problematic situations (TPS)', '\r\n\r\nOften therapists are confronted with typical difficult situations (TPS) that can be described macroanalytically (patient comes late, does not want to talk about relevant topics, bill is not payed etc.). However, there are many more TPS that can be described micro-analytically only. The CEMPP-Project (Conversation Analysis of Empathy in Psychotherapy Process) delivers data on these TPS. Some of them will be presented and clinical proposals are made how to handle them.\r\n\r\nKonuma hatalar  Psikoterapistlerin tipik problemli durumlarda nasl konutuklarnn detaylarna bakmak\r\n\r\nGenellikle, terapistler makro analitik (hastann ge gelmesi, ilgili konular hakknda konumak istememesi, cretin denmemesi vb.) olarak tanmlanan tipik zor srelerle (TPS) kar karya kalrlar. Buna ramen, daha birok mikro analitik olarak tanmlanabilecek tipik zor sreler vardr. Psikoterapi srecindeki empatinin konuma analizi- CEMPP Projesi (Conversation Analysis of Empathy in Psychotherapy Process) tipik zor sreler zerinde veri sahibi olmamz salar. Bu verilerden bazlar sunulacak ve bunlarla nasl baa klacana dair klinik neriler yer alacaktr.\r\n', '', '', '', '2016-06-19', '', 'short', NULL, NULL, NULL, NULL, NULL, '2016-06-19', 1),
(3349, 0, 1359, 0, 'Sahhar, Nicola', 'Eroticized Transference as a search for a rational home for being: Changes in \r\nunderstanding during a course of analytic psychotherapy.\r\n\r\nEroticized transference in traditional psychoanalytic literature is regarded as a complex form of transference involving reality distortions serving complex defensive needs. These transferences present great challenges during treatment and sometimes have led analysts to consider such patients incurable.\r\n\r\nThis paper describes a course of long term psychoanalytic treatment with a woman of Arabic origin in her mid-thirties, during which the understanding of eroticized transference had to be significantly shifted from its traditional conceptualization. While in the beginning of the treatment the notion of reality distortion had guided the analyst, another meaning of the expressed erotic currents crystallized. Instead of distortions they have been understood as expressions of authenticity. Moreover, the therapists own defenses and emotional responses became another core of change. Thus, this course of psychoanalytic treatment illustrates Brandchafts ideas described in: Toward an Emancipatory Psychoanalysis (2010).\r\n\r\nVar olabilmek iin erotik aktarm aray: Psikanalitik Psikoterapi Srecindeki Deiimleri Anlamak\r\n\r\nKlasik psikanaliz literatrnde; erotik aktarm, savunma mekanizmalarna hizmet eden gereklikte arpklk ieren aktarm biimi olarak ele alnr. Bu aktarm biimleri, tedavide\r\nmcadele gerektiren durumlar yaratr ve hatta psikanalistleri bu hastalarn iyiletirilemeyeceini dndrtr.\r\n\r\nBu alma, Arap asll otuzlarnn ortasnda olan bir bayan hastayla uzun soluklu psikanaliz\r\nalmasnda; erotik aktarmn geleneksel tanmlanmasndan farkl bir biimde anlalmasn ele alr. almann balangcnda psikanaliste gereklikteki arpklk fikri yn verse de, ifade edilen erotik akm belirgin hale geldi. Erotik akm, arpklklar yerine, otantikliin ifadesi olarak anlald. Ayrca; analistin kendi savunmalar ve duygusal cevaplar da deiimin ayr bir ekirdei haline geldiler. Bylelikle; psikanaliz almas, Brandchaftn zgrletirici Psikanalize Doru (2010) fikirlerine rnek tekil eder.\r\n\r\n', '', '', '', '2016-06-19', '', 'short', NULL, NULL, NULL, NULL, NULL, '2016-06-19', 1),
(3350, 0, 1359, 0, 'Reghintovschi, Anatol', 'A Dreaming Body\r\n\r\nIn the paper, a fragment from a psychoanalytic psychotherapy offers support for a hypothesis regarding hypochondria and mystification. The assumption made here regards one movement, involving a thought without a thinking process to engage it. Also it opens a perspective over self-deception and probes the form and function of paradox, infused at interpersonal level. In asking how deceiving oneself self-induces mental pain and how this pain is able to travel between minds, what becomes clear is that the process equates a complex process through which a body is given to a dream.  \r\n\r\nRya Gren  Hayal Kuran Beden \r\n\r\nBu alma, psikoanalitik psikoterapi iinden bir alntda; hipokondria ve mistisizm iin destek salar. Buradaki varsaym tek bir adm ierir: Dnme sreci olmakszn yer alan dnce Bu durum ayn zamanda kiinin kendi kendini yanltmas ve kiiler aras dzeyde paradoks bir form ve ilevle sonlanan iie geen bir perspektif salar. Kiinin kendini aldatmas zihinsel acy uyarr ve bu ac zihinler arasnda gezinebilir. Net bir biimde ortaya kan ey, bedenin hayale/ryaya kendini brakna denk den karmak bir sretir.\r\n', '', '', '', '2016-06-19', '', 'short', NULL, NULL, NULL, NULL, NULL, '2016-06-19', 1),
(3351, 0, 1359, 0, 'Karaburak nsal, Zehra', 'WHEN THE GAS LEAKS INTO THE ROOM\r\n\r\n The psychoanalytic frame, as described by Freud, represents the set of rules required for the well functioning of the psychoanalytic process. Part of them consists of the technical regulations such as the frequency of sessions, their length, the mode of payment etc while another part containing free association, principles of neutrality, abstinence and inhibition of action helps the analysand to reach while talking, his/her unconscious memories, fantasies and also, the appearance of the transference phenomenon via the projection of the analysands representations to a nearly blank screen. The frame remains silent and deaf as far as no transgression appears : for the analysand it is a special situation never encountered in current life; a setting he/she accepts without questioning and tries to handle by himself.\r\nBut along with the new developments in the psychoanalytic practice, this constant setting that does not carry any particular process and thus cannot be analyzed gained a new quality. Especially Blegers new elaboration of the frame placed the frame to the position of both a container and the object of transference. The direct link between counter transference and frame was largely emphasized. The frame was considered as the place where the analysts inner frame was externalized and came about hence we began to say that the counter transference came before the transference. Thinking about the frame could not be done without taking into account the leaking of the analysts counter transferential parts into the analysands inner psychic reality.  Thus the frame itself became the object of analysis.\r\nThis new approach brings in the problem of the role played by the actual reality during the analytic process. At the beginning the intrusion of outer and actual reality was considered as a resistance but in this presentation I would like to point out that the avoidance of the actual can be a way of denial itself and also a resistance. In opposition to classical psychoanalytic practice in which the analyst tries to hold on very strictly to the frame and refrains himself/herself on giving anything but interpretations, it is very important to see that the infiltrations and collusions created by the errors or transgressions of the analyst have transformative and deepening effects in the analytic process. \r\nEspecially if both the analyst and the analysand are sharing the same actuality\r\nOur confrontation with this difficult matter really began with the Gezi events. We psychoanalysts were deeply concerned about the frame, the counter transferantial collusions, the collective trauma and the actual. This new and quite unusual situation provoked very enriching discussions concerning psychoanalytic theory and practice. \r\nIn this presentation these concepts are going to be discussed with the help of certain clinical vignettes, taking into account the various  psychic experiences related to the different phases starting with the Gezi events until todays current situation and their reflections into the analytic process.    \r\n', '', '', '', '2016-06-19', '', 'short', NULL, NULL, NULL, NULL, NULL, '2016-06-19', 1),
