(3356, 0, 1360, 0, 'Sahhar, Nicola ', 'He works as a clinical psychologist, psychoanalyst and supervisor in a licensed practice in Cologne. He is board member and responsible for training of members in the Institute for Psychoanalysis and Psychotherapy in the Rhineland, Cologne (IPR). He is certified trainer for assessments of attachment from infancy to adulthood and founding member of the Institute for the Study of Attachment (IASA). \r\n', '', '', '', '2016-06-19', '', 'short', NULL, NULL, NULL, NULL, NULL, '2016-06-19', 1),
