(3358, 0, 1360, 0, 'Erten, Yavuz Prof.', 'Training and supervising psychoanalyst and clinical psychologist. He is the direct member of International Psychoanalytic Association (IPA). He is in private practice. He is the founding member and the chair of the publication committee of Psike Istanbul. He is in the faculty of IPA Turkish Study Group. Hes the co-author of the book called From Psychoanalysis to Dynamic Psychotherapies (1999), co-editor of the books, The Other Face of Psychoanalysis: Heinz Kohut (2003) and The Knowledge of Psyche by The Perspectives of Science and Philosophy (2006) and the author of the book The Faces in the Dark Room (2010). His numerous articles are published in various journals.  \r\n', '', '', '', '2016-06-19', '', 'short', NULL, NULL, NULL, NULL, NULL, '2016-06-19', 1),
