(3552, 0, 1414, 0, 'Guilherme Kirsten,  Porto Alegre', 'Guilherme Kirsten Barbisan: Specialized in Analytical Psychotherapy from the Centro de Estudos Lus Guedes (2015), Medical Residency in Psychiatry (2012-2015) and Psychotherapy (2015-2016) at the Hospital de Clnicas in Porto Alegre, a medical degree from the Pontifical Catholic University of Rio Grande do Sul (2011). Participated as a visitor to the Program: The Tavistock and Portman NHS Foundation Trust, London (2014). Currently, participates as researcher of the Research Project in Psychotherapy of the Faculty of Medicine of the Federal University of Rio Grande do Sul - Brazil. Has experience in Medicine, with emphasis in Psychiatric Medicine (psychotherapy).', '', '', '', '2017-03-03', '', 'short', NULL, NULL, NULL, NULL, NULL, '2017-07-18', 1),
