(3554, 0, 1157, 0, '0 LPC-Ulm', 'Kompetenzzentrums fr seelische und krperliche Gesundheit am Arbeitsplatz Leadership Personal Care Ulm (LPCU) der Universitt Ulm.\r\nLeiter Prof. Gndel und PD Hlzer\r\ngefrdert von der KSG', '', 'Die Psychosomatische Sprechstunde im Betrieb ist eine Kooperation zwischen Fachleuten fr seelische Gesundheit, zum Beispiel der Sonnenbergklinik in Stuttgart oder der Uni- versittsklinik fr Psychosomatik in Ulm, und Unternehmen der jeweiligen Region und deren Gesundheitsdiensten. Forschungs- ergebnisse belegen, dass Beschftige, vor allem Mnner, die sonst eher spt Hilfe suchen, dieses Angebot bei Frhwarnzei- chen nutzen. Mit dem Ziel, die seelische und krperliche Ge- sundheit am Arbeitsplatz praxisnah weiter zu erforschen und zu verbessern, wurde 2017 das Kompetenzzentrum fr seelische und krperliche Gesundheit am Arbeitsplatz (Leadership Personality Center Ulm, LPCU) an der Universitt Ulm gegrn-\r\ndet. Durch die Karl-Schlecht-Stiftung nanziert, ist die Einrichtung eine Kooperation der Klinik fr Psychosomatische Medizin und Psychotherapie Ulm, der Sonnenbergklinik Stuttgart und damit des ZfP Sdwrttemberg.', 'LPC_Ulm_2016.09.ppt.pdf', '2017-03-06', '', 'short', NULL, NULL, NULL, NULL, NULL, '2018-02-28', 1),
(3555, 0, 1307, 0, 'Psychoanalyse und Ethik', 'Erstverffentlichung  unter  dem  Titel \r\nMan  for  Himself.  An  Inquiry  into  the  Psychology  of Ethics, New  York  1947  (Rinehart  &  Co.);  deutsch  erstmals  verffentlicht unter  dem  Titel \r\nPsychoanalyse und Ethik, \r\nZrich 1954 (Diana Verlag); in berarbeiteter Form und bersetung neu verffentlicht worden unter dem Titel \r\nPsychoanalyse und Ethik. Bausteine zu einer  humanistischen  Charakterologie, \r\nStuttgart  1979  (Deutsche  Verlags-Anstalt). \r\n', '', '', 'Fromm_Psychoanalyse_und_Ethik_1947-.pdf', '2017-03-07', '', 'short', NULL, NULL, NULL, NULL, NULL, '2017-07-27', 1),
(3556, 0, 1418, 0, 'Aulendorf 20..-2016', 'Lieber Herr Kchele, \r\n.....Und dafr mchte ich mich bei Ihnen auch im Namen des Teams sehr herzlich bedanken. Die Supervisionen mit Ihnen waren immer in  kreativer Weise lebendig , haben ber den Horizont hinaus gefhrt und einen breiten Rahmen gehabt. Allein das ist in einer Arbeit, in der wir es mit Chronifizierung, eingeengten Denkweisen  und immer neuen Grabenkriegen zu tun haben, erfrischend. Fr Ihren Beitrag dazu herzlichen Dank, Herr Kchele.\r\nIch wnsche Ihnen erholsame Weihnachtstage in Ihrer Familie und den Frieden, den wir uns alle wnschen. Frs neue Jahr alles erdenklich Gute, vor allem Gesundheit.  Wir werden uns im neuen Jahr hier sicher mal ber den Weg laufen.\r\n \r\n \r\nMit freundlichen Gren\r\nR.Schfer\r\n \r\n \r\nDipl.-Psych. Reinhardt Schfer\r\npsycholog. Psychotherapeut\r\n \r\nreinhardt.schaefer@schussental-klinik.de\r\n07525-932887\r\nSchussental Klinik GgmbH\r\n', '', '', '', '2017-03-13', '', 'short', NULL, NULL, NULL, NULL, NULL, '2017-03-13', 1),
