(3635, 0, 1455, 0, 'Announcement', 'We announce the 4th conference on Psychoanalytic Process Research Strategies that will take place at the International Psychoanalytic University in Berlin on June 15-17, 2017.\r\n\r\nThe conference focuses on conversational strategies in psychoanalytic process!\r\n\r\nIt will start with a warming-up lecture by P. Fonagy at 5pm. on thursday evening.\r\n\r\nOn Friday the specimen case Amalia X will be the focus of three presentations by Prof. Bergmann (Bielefeld), Prof. Perkyl (Helsinki) and Prof. Buchholz (Berlin); I shall start with an overview on themes of psychoanalytic process research across the last fifty years.\r\n\r\nOn Saturday we shall debate a recorded specimen of TFP and MBT. Prof. Doering (Vienna) and Prof. Taubner (Heidelberg) will present the clinical level; two  specialists on conversational analysis, Prof. Pfnder (Freiburg) und Prof. Lepper (Manchester) will provide the micro- perspective.\r\n\r\n', '', '', '', '2017-05-27', 'PPRS_IV_Title.png', 'short', NULL, NULL, NULL, NULL, NULL, '2017-05-27', 1),
(3636, 0, 1474, 0, 'Psychoanalytic Process Research Strategies I', 'In 1985 as a pre-conference to the International Psychoanalytic Congress in Hamburg  the Department of Psychotherapy organized the first conference  on Psychoanalytic Process Research  strategies. This conference documented the creation of a field, as Hartvig Dahl put it. The proceedings were later published and the book is still available on my homepage.', '', '', '', '2017-05-27', '', 'short', NULL, NULL, NULL, NULL, NULL, '2017-05-27', 1),
