(3682, 0, 872, 0, 'Hommage by Sid Blatt', 'A very sad loss. Hartvig was deeply dedicated to psychoanalysis and science; he worked, wrote and debated with passion, and made outstanding contributions. He will be  missed but his contributions to understanding the complexities of the psychoanalytic and the therapeutic process more generally will be cited for many years to come.  \r\nHartvig was very special--a very talented and deeply dedicated investigator who in many ways never really received the recognition that he so very much deserved.\r\nHis work was ground breaking!! \r\nSid Blatt\r\n\r\n', '', '', '', '2017-06-21', '', 'short', NULL, NULL, NULL, NULL, NULL, '2017-06-21', 1),
