(4051, 0, 1629, 0, 'Todes-Nachricht vom 8.12.18', 'Liebe Kolleginnen und Kollegen, \r\nuns hat heute die traurige Nachricht erreicht, das Harald Freyberger, der auch Mitglied unseres AG ist, pltzlich verstorben ist. Einige haben ihn sicher noch auf der DGPPN-Tagung am Wochenende munter und guter Laune erlebt. Ich kenne ihn schon seit 25 Jahren, er war so ein besonders liebens-werter und humorvoller Mensch, der sich unerschrocken fr das durchaus schwierige Ost-West- Ver-hltnis eingesetzt hat, vielen von uns ist er auch aus seiner Aktivitt in der OPD bekannt. Harald Freyberger hat viele Ost-Patienten mit Flucht und Gefngniserfahrungen gesehen und auch die Westrckkehrer in ihre alte Heimat, den Osten betreut--und damit eine ganz besondere deutsch- deutsche Perspektive in das aktuelle Themas Flucht und Migration eingebracht. Und er hat es mit einem Augenzwinkern getan, mit dem gelben Bananensticker am Revers. \r\nFr den Vorstand der AG\r\nInge Seiffge-Krenke\r\n', '', '', '', '2018-12-08', '', 'short', NULL, NULL, NULL, NULL, NULL, '2018-12-08', 1),
