(3977, 0, 1118, 0, 'Research issues in psychoanalysis', 'Fonagy P Research issues in psychoanalysis \r\nThe situation within which psychoanalysis has to exist today has radically changed from the conditions which prevailed 30 or 40 years ago.  There are two major aspects to this change: (a) there have been major advances in the basic sciences underpinning clinical work in the mental health field; (b) there has been a rapid development of relatively effective approaches to the treatment of many of the mental disorders which had previously been the unique purview of psychoanalytic clinicians.  Under the first category, one could single out the biological revolution, particularly our increased understanding of brain function and under the second the cognitive revolution in psychology.  ', '', '', '', '2018-08-29', '', 'short', NULL, NULL, NULL, NULL, NULL, '2018-09-24', 1),
