(4001, 0, 1603, 0, 'Affective Scripts FRAMES', 'Siegel, P., & Demorest, A. (2010). Affective scripts: A systematic case study of change in psychotherapy. Psychotherapy Research, 20(4), 369-387. ', '', 'This article presents a systematic case study of maladaptive interpersonal schemas. These schemas are conceived of as affective scripts, or sequences of behaviors that regulate emotion in interpersonal relationships. Part I presents a test of the method for identifying affective scripts. Independent raters applied FRAMES (Fundamental Repetitive and Maladaptive Emotion Structures; Hoelzer & Dahl, 1996) to a representative sample of transcripts of a long-term psychotherapy. Empirical checks of each assessment procedure verified the identification of five maladaptive scripts in hundreds of narratives and enactments with the therapist. In Part II, these scripts were tracked across treatment to identify adaptive changes. Statistical analyses indicated a reduction in maladaptive scripts and an increase in adaptive changes. The evolution of the most pervasive script is described in detail. Strengths and weaknesses of the method are discussed.', 'Siegel_u_Demorest_affective_scripts.pdf', '2018-08-30', '', 'short', NULL, NULL, NULL, NULL, NULL, '2018-08-31', 1),
