(4088, 0, 1638, 0, 'Gerlach + Elzer s Textbook', 'The basic idea of this book is to give the reader an introductory understanding of the psychoanalytic theory of the human mind, the psychic development, psychic conflicts, trauma, symptom formation, and dreams. Related to these theoretical aspects the book then introduces the fundamentals of psychoanalytic-oriented psychotherapy. The first part of this book deals with important technical aspects of the psychotherapeutic treatment such as the therapeutic relationship, the setting, the diagnosis, and the process of treatment. The second part explores the psychoanalytic understanding of specific clinical disorders, including neuroses and personality.Psychoanalytic Psychotherapy: A Handbook seeks to provide a complete overview from a psychoanalytical point of view of theoretical and clinical aspects of psychodynamic or psychoanalytic psychotherapy.', '', '', '', '2019-01-25', 'Gerlach_+_Elzer_Psychoanalytic_Psychotherapy.png', 'short', NULL, NULL, NULL, NULL, NULL, '2019-04-06', 1),
